import React, {Component, components} from 'react'
import GameCard from './GameCard'

class GameList extends Component {
    render(){
        return (
            <>
            <h1> Game </h1>
            <div style={{display: 'flex'}}>
                {this.props.games.map(games => <GameCard {...games}/>)}
            </div>
            </>
         )
    }
}

export default GameList
